function App() {
  return (
    <ChakraProvider  bg ="white">
      <Container>
        <Box textAlign="center" fontSize="xl" bg ="white" minH="100vh">

        halo
        </Box>
      </Container>
    </ChakraProvider>
  );
}

export default App;
